import React from 'react'
import SingleArrangement from './SingleArrangement'
import { useState, useEffect } from 'react'
import axios from 'axios'

const Store = () => {
    const [arrangement, setArrangement] = useState();
    useEffect(() => {
        if(arrangement == null) {
            axios.get("api/arrangements").then((res) => {
                console.log(res.data);
                setArrangement(res.data.arrangement);
            });
        }
    }, [arrangement]);

  return (
 <div>
    <h3>Aranzmani</h3>
    {arrangement == null ? <></> : arrangement.map((a) => <SingleArrangement a={arrangement} key={arrangement.key}/>)}

 </div>



    );
};

export default Store
